import "./styles/App.css";
import Header from "./components/Header";
import { ChakraProvider, Button, Spinner } from "@chakra-ui/react";
import InputFields from "./components/InputFields";
import { useState } from "react";

function App() {
  const [isLoading, setIsLoading] = useState(false);
  const [viewResult, setViewResult] = useState(false);

  var predictionResponse = "";

  const getPrediction = async () => {
    setIsLoading(true);

    const res = await fetch(awsTestUrl, {
      method: "GET",
    })
      .then((response) => response.json())
      .catch((error) => console.error(error));

    setIsLoading(false);

    if (res) {
      setViewResult(true);
      predictionResponse = res;
    }
  };

  return (
    <div className="h-screen mx-auto">
      <Header />

      <main className="flex flex-col items-center">
        {isLoading && (
          <div className="mt-60">
            <Spinner size="xl" thickness="4px" />
          </div>
        )}

        {!isLoading && !viewResult && (
          <>
            <div className="w-full">
              <InputFields />
            </div>
            <div className="mt-6">
              <Button onClick={getPrediction} colorScheme="red">
                View Prediction
              </Button>
            </div>
          </>
        )}

        {!isLoading && viewResult && (
          <div>
            <h1>Prediction:</h1>
            <p1>{predictionResponse.body}</p1>
          </div>
        )}
      </main>
    </div>
  );
}

export default App;

const awsTestUrl =
  "https://lryw2w5i7nr5ysubsumkcn4ssu0fprbu.lambda-url.us-east-1.on.aws/";
